inboundBar.translations.de_DE={"chat-header-agent-available":"Wenn Sie mit einem EMC Vertriebsmitarbeiter sprechen möchten, machen Sie die folgenden Angaben und wählen Sie „Chat starten“ aus.","chat-header-agent-available-iig":"     ","chat-header-agent-available-rsa":"     ","chat-label-start-chat":"CHAT STARTEN","chat-header-agent-not-available":"Momentan ist kein Support für Deutsch verfügbar. Sie können entweder in einer anderen Sprache chatten oder eine Nachricht für einen Sales Specialist hinterlassen. Wir melden uns dann innerhalb eines Geschäftstags bei Ihnen.","chat-label-chat-alt-lang":"IN ANDERER SPRACHE CHATTEN","chat-label-leave-message":"NACHRICHT HINTERLASSEN","chat-label-send-message":"NACHRICHT SENDEN","chat-header-no-agents":"Danke, dass Sie sich an EMC gewandt haben. Leider sind gerade alle Mitarbeiter offline oder befinden sich im Gespräch mit anderen Kunden. Besuchen Sie für technischen Support unser Servicecenter. Füllen Sie für Sales-Anfragen das unten stehende Formular aus. Wir melden uns dann innerhalb eines Geschäftstags bei Ihnen.","chat-header-no-agents-iig":"     ","chat-header-no-agents-rsa":"     ","general-all-fields-required":"Alle Felder sind Pflichtfelder, soweit nicht anders angegeben. (*)","ib-button-ok":"OK","ib-chat-lang-dropdown":"Andere Sprache wählen ...","ib-error-chat-general":"Es ist ein Problem mit dem Chat aufgetreten. Versuchen Sie es später erneut.","ib-error-chat-form-validation":"Bitte prüfen Sie Ihre Einträge und geben Sie gültige Informationen in die markierten Felder ein.","ib-error-panel-loading":"Beim Laden des Panels ist ein Problem aufgetreten. Laden Sie die Seite noch einmal und versuchen Sie es erneut.","ib-chat-offline-success":"Vielen Dank für Ihre Anfrage! Einer unserer Vertriebsmitarbeiter wird in Kürze Kontakt mit Ihnen aufnehmen.","technical-inquiry-redirect":'<p>Danke, dass Sie sich an EMC gewandt haben. Sie haben angegeben, dass Sie technischen Support benötigen. Sie können unser Support-Team über den folgenden Link kontaktieren</p><p>Bei technischen Fragen besuchen Sie <a href="https://support.emc.com/servicecenter/contactEMC/?siteLocale=de_DE" title=" Besuchen Sie den EMC Online-Support" target="_blank">Klicken Sie auf diesen Link, um direkt zum EMC Online-Support zu gelangen.</a></p><p>Danke für Ihr Interesse an EMC.</p>',"technical-inquiry-redirect-iig":"     ","technical-inquiry-redirect-rsa":"     ","chat-window-live-chat":"LIVE-CHAT","chat-window-send":"SENDEN","chat-window-end":"CHAT BEENDEN","chat-window-agent-typing":"Mitarbeiter tippt gerade eine Nachricht…"};
inboundBar.translations.fr_FR={"chat-header-agent-available":"Pour communiquer avec un spécialiste des ventes EMC, fournissez les informations suivantes, puis cliquez sur Démarrer le chat.","chat-label-start-chat":"DÉMARRER LE CHAT","chat-header-agent-available-iig":"     ","chat-header-agent-available-rsa":"     ","chat-header-agent-not-available":"Aucun agent n&#0146;est actuellement disponible pour le français. Vous pouvez communiquer dans une autre langue, ou laisser un message textuel afin qu&#0146;un commercial vous réponde dans les 24 heures.","chat-label-chat-alt-lang":"COMMUNIQUER DANS UNE AUTRE LANGUE","chat-label-leave-message":"LAISSER UN MESSAGE","chat-label-send-message":"ENVOYER UN MESSAGE","chat-header-no-agents":"Merci d’avoir contacté EMC. Tous nos agents sont actuellement hors ligne ou occupés à aider d’autres clients. Pour accéder au support technique, rendez-vous dans notre Centre de services. Pour toute demande d’ordre commercial, veuillez remplir le formulaire ci-dessous et nous vous répondrons dans les 24 heures.","chat-header-no-agents-iig":"     ","chat-header-no-agents-rsa":"     ","general-all-fields-required":"Tous les champs sont obligatoires sauf mention contraire (*)","ib-button-ok":"OK","ib-chat-lang-dropdown":"Sélectionnez une autre langue...","ib-error-chat-general":"Désolé, il y a eu un problème avec le chat. Veuillez réessayer ultérieurement.","ib-error-chat-form-validation":"Veuillez vérifier les valeurs saisies et renseigner des informations valides dans les champs en surbrillance.","ib-error-panel-loading":"Une erreur s’est produite lors du changement de cette section, veuillez recharger cette page et essayer de nouveau","ib-chat-offline-success":"Merci de votre demande. Un représentant commercial vous contactera rapidement.","technical-inquiry-redirect":'<p>Merci d’avoir contacté EMC. Vous avez indiqué avoir besoin d&#0146;un support technique. Notre équipe de support est disponible au lien suivant</p><p>Pour obtenir une réponse à votre problème technique, rendez-vous sur <a href="https://support.emc.com/servicecenter/contactEMC/?siteLocale=fr_FR" title=" Rendez-vous sur le site du Support en ligne d’EMC " target="_blank">Rendez-vous directement sur le site du Support en ligne d’EMC en cliquant sur ce lien</a></p><p>Nous vous remercions de l’intérêt que vous portez à EMC.',"technical-inquiry-redirect-iig":"     ","technical-inquiry-redirect-rsa":"     ","chat-window-live-chat":"CHAT EN DIRECT","chat-window-send":"ENVOYER","chat-window-end":"FIN CHAT","chat-window-agent-typing":"L’agent est en train d’écrire…"};
inboundBar.translations.zh_CN={"chat-header-agent-available":"若要与 EMC 销售专家聊天，请填写下面的信息并选择“开始聊天”。","chat-header-agent-available-iig":"     ","chat-header-agent-available-rsa":"     ","chat-label-start-chat":"开始聊天","chat-header-agent-not-available":"当前没有中文销售工程师。 您可以使用其他语言聊天，或者如果您喜欢，可以留言，我们的销售工程师会在一个工作日内回复。","chat-label-chat-alt-lang":"用其他语言聊天","chat-label-leave-message":"留言","chat-label-send-message":"发送留言","chat-header-no-agents":"感谢您与 EMC 联系。 很抱歉，目前所有销售工程师或者离线或者正在帮助其他人。 对于技术支持，请访问我们的服务中心。 有关销售查询，请填写下面的表单，我们将在一个工作日内进行答复。","chat-header-no-agents-iig":"     ","chat-header-no-agents-rsa":"     ","general-all-fields-required":"除非另有说明，所有表项都需要填写。 (*)","ib-button-ok":"好","ib-chat-lang-dropdown":"请选择其他语言...","ib-error-chat-general":"很抱歉，聊天程序有些问题。 请稍后重试。","ib-error-chat-form-validation":"请检查您的条目并对高亮字段输入有效信息。","ib-error-panel-loading":"加载这个窗格出错，请重新加载这个页面再试。","ib-chat-offline-success":"谢谢您抽出宝贵时间参加本次演示。很快将有一名销售代表与您联系.","technical-inquiry-redirect":'<p>感谢您与 EMC 联系。您已表明您需要技术支持。您可以通过以下链接与我们的支持团队联系</p><p>有关技术查询，请通过此链接<a href="https://support.emc.com/servicecenter/contactEMC/" title="访问 EMC 在线支持" target="_blank">直接访问 EMC 在线支持.</a></p><p>感谢您对 EMC 的关注</p>',"technical-inquiry-redirect-iig":"     ","technical-inquiry-redirect-rsa":"     ","chat-window-live-chat":"实时聊天","chat-window-send":"发送","chat-window-end":"结束聊天","chat-window-agent-typing":"代理正在打字..."};
