inboundBar.translations.es_MX={"chat-header-agent-available":"Para chatear con un especialista de ventas de EMC, complete el siguiente formulario y seleccione Iniciar chat.","chat-header-agent-available-iig":"     ","chat-header-agent-available-rsa":"     ","chat-label-start-chat":"INICIAR CHAT","chat-header-agent-not-available":"En estos momentos no hay ningún agente disponible que le pueda atender en español. Puede chatear en otro idioma o, si lo prefiere, dejar un mensaje de texto y un especialista en ventas le responderá en el transcurso de un día laborable.","chat-label-chat-alt-lang":"CHATEAR EN OTRO IDIOMA","chat-label-leave-message":"DEJAR UN MENSAJE","chat-label-send-message":"ENVIAR MENSAJE","chat-header-no-agents":"Gracias por ponerse en contacto con EMC. Sentimos comunicarle que todos nuestros agentes están desconectados o ayudando a otros usuarios. Para obtener asistencia técnica, visite nuestro Centro de servicios. Para consultas sobre ventas, rellene el siguiente formulario y obtendrá respuesta en el plazo de un día laborable.","chat-header-no-agents-iig":"     ","chat-header-no-agents-rsa":"     ","general-all-fields-required":"Todos los campos son obligatorios a menos que se indique lo contrario (*)","ib-button-ok":"Aceptar","ib-chat-lang-dropdown":"Elegir otro idioma…","ib-error-chat-general":"Lo sentimos, ha habido un problema con el chat. Vuelva a intentarlo más tarde.","ib-error-chat-form-validation":"Revise los campos resaltados y corríjalos con información válida.","ib-error-panel-loading":"Hubo un error al cargar este panel. Vuelva a cargar la página e inténtelo de nuevo.","ib-chat-offline-success":"Gracias por su solicitud. Un representante de ventas se pondrá en contacto con usted a la brevedad.","technical-inquiry-redirect":'<p>Gracias por comunicarse con EMC. Indicó que busca soporte técnico. Nuestro equipo de soporte técnico está disponible por medio del siguiente enlace</p><p>Para realizar una consulta técnica, <a href="https://support.emc.com/servicecenter/contactEMC/" title="Visit EMC Online Support" target="_blank">Visite el servicio de soporte en línea de EMC directamente por medio de este enlace.</a></p><p>Gracias por su interés en EMC.</p>',"technical-inquiry-redirect-iig":"     ","technical-inquiry-redirect-rsa":"     ","chat-window-live-chat":"CHAT EN VIVIO","chat-window-send":"ENVIAR","chat-window-end":"CERRAR","chat-window-agent-typing":"El agente está escribiendo..."};
